import React from 'react';
import './style.css';
import { useHistory } from 'react-router';

    const Button = () => {

        let histosy = useHistory();

        return (
        <div>
            <button type="button" className="btn btn-warning">More Details</button>
        </div>
        )
    }
    const CARD = props => {
        return (
            <div className="card text-center">
                <div className="card-body">
                    <h4 className="card-title">{props.name}</h4>
                    <p className = "card-text">{props.nickname}</p>
                    <a href="hildegard.org">{props.website}</a>
                    <Button/>
                </div>
            </div>
        );
    }

export default CARD;
